response.about:
Я - ветер...

ВНИМАНИЕ!!! Я никогда не прошу:
- скинуть мне денег на телефон или оплатить мой счет;
- проголосовать за меня или кого-нибудь еще;
- зайти по какой-нибудь ссылке и т.п.
Если мне вдруг приспичит сделать подобную глупость, я сделаю это так, чтобы было очевидно, что такая просьба исходит именно от меня.
